import React from 'react';
import './styles.css';

export default function Diary() {
  return (
    <div className="app-container">
      <div className="welcome-message">
        <h2>Welcome to DayLog</h2>
      </div>
      <div className="content-container">
        <div className="bg-gradient">
          <h1>DayLog</h1>
        </div>
      </div>
    </div>
  );
}
